CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pozos_noc_en_cuenca`(IN p_cuenca VARCHAR(20))
BEGIN
	/* Quiero ver el listado de los pozos de tipo No Convencional
    para cada cuenca en Argentina
		CRITERIOS: AUSTRAL/ GOLFO SAN JORGE /NEUQUINA
    */
    
    CASE trim(p_cuenca)
    WHEN 'Austral' 
		THEN 
			SELECT we.pozo as 'Pozo', op.operadora as 'Operadora', ty.tipo as 'Tipo', cu.cuenca as 'Cuenca'
			FROM pozos as we, operadoras as op, tipo as ty, cuenca as cu
            WHERE we.id_operadora = op.id_operadora
            AND we.id_tipo = ty.id_tipo
            AND ty.tipo = 'No Convencional'
			AND we.id_cuenca = cu.id_cuenca
            AND cu.cuenca = 'AUSTRAL';
            
		SELECT distinct(count(we.id_pozo)) as 'total_pozos'
FROM pozos as we
WHERE we.id_cuenca = 
		( select id_cuenca 
		from cuenca 
		where cuenca = 'Austral')
AND we.id_tipo = 
	( select id_tipo 
		from tipo
		where tipo = 'No Convencional')
;
       
    WHEN 'Neuquina' 
		THEN 
			SELECT we.pozo as 'Pozo', op.operadora as 'Operadora', ty.tipo as 'Tipo', cu.cuenca as 'Cuenca'
			FROM pozos as we, operadoras as op, tipo as ty, cuenca as cu
            WHERE we.id_operadora = op.id_operadora
            AND we.id_tipo = ty.id_tipo
            AND ty.tipo = 'No Convencional'
			AND we.id_cuenca = cu.id_cuenca
            AND cu.cuenca = 'Neuquina';
            
    SELECT distinct(count(we.id_pozo)) as 'total_pozos'
		FROM pozos as we
		WHERE we.id_cuenca = 
			( select id_cuenca 
			from cuenca 
			where cuenca = 'Neuquina')
	AND we.id_tipo = 
			( select id_tipo 
				from tipo
				where tipo = 'No Convencional')
;
	
	WHEN 'Golfo San Jorge' 
		THEN 
			SELECT we.pozo as 'Pozo', op.operadora as 'Operadora', ty.tipo as 'Tipo', cu.cuenca as 'Cuenca'
			FROM pozos as we, operadoras as op, tipo as ty, cuenca as cu
            WHERE we.id_operadora = op.id_operadora
            AND we.id_tipo = ty.id_tipo
            AND ty.tipo = 'No Convencional'
			AND we.id_cuenca = cu.id_cuenca
            AND cu.cuenca = 'Golfo San Jorge';
            
    SELECT distinct(count(we.id_pozo)) as 'total_pozos'
FROM pozos as we
WHERE we.id_cuenca = 
		( select id_cuenca 
		from cuenca 
		where cuenca = 'Golfo San Jorge')
AND we.id_tipo = 
	( select id_tipo 
		from tipo
		where tipo = 'No Convencional')
;   
                       
	ELSE 
		SELECT 'Verificar que el nombre de la cuenca sea Austral, Neuquina o Golfo San Jorge' AS msg_error;
    END CASE;
END ;;
