CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_resumen_de_pozo`( IN p_pozo VARCHAR(30)
)
BEGIN
			-- Controlando que existe --
DECLARE v_pozo_dato INT default 0;

SET @pozo_busqueda = CONCAT('%', p_pozo, '%');

			-- ahora cuento las filas que aparecen para ese pozo X
			SET v_pozo_dato = (SELECT COUNT(*) 
			FROM pozos as we
			WHERE we.pozo LIKE @pozo_busqueda);
    
			-- viene el procedimiento
IF v_pozo_dato > 0 THEN 

select we.pozo as 'Pozos', op.operadora as 'Operadora', pr.provincia as 'Provincia', cu.cuenca as 'Cuenca', co.concesion as 'Concesion'
,		ty.tipo as 'Tipo', su.subtipo as 'subtipo', count(fr.id_operacion) as 'Total_operaciones_frac'
from 	pozos as we
,		operadoras as op
,		provincia as pr
,		cuenca as cu
,		concesiones as co
,		tipo as ty
,		operaciones as fr
,		subtipo as su
where we.pozo like @pozo_busqueda
AND we.id_operadora = op.id_operadora
AND we.id_provincia = pr.id_provincia
AND cu.id_cuenca = we.id_cuenca
AND we.id_concesion = co.id_concesion
AND we.id_tipo = ty.id_tipo
AND fr.id_pozo = we.id_pozo
AND fr.id_subtipo = su.id_subtipo
GROUP BY we.pozo,op.operadora,pr.provincia,cu.cuenca,co.concesion,ty.tipo,su.subtipo
;
ELSE SELECT 'Pozo no reconocido' as msg_error;
END IF;

END ;;
